import React from 'react';
import { Grid } from '@material-ui/core';

import Product from './Product/Product';
import useStyles from './styles';
// import logo from '../../assets/Fall-With-Grapes'

const products = [
    { id: 1, name: 'Fall with Grapes', description: 'Sit down at your dinning table with the view of this wonderful fall decoration.', price: '$25', image: 'https://lh3.googleusercontent.com/LSWSgdKuzMAf6lH73r-PJ7ZQm27S8jYxc46tozpR_-SEiCZ4fBAVNITJgsI0_1vsESWH=s85'},
    { id: 2, name: 'Half a Moon', description: 'Fall is here! Pumpkin spice things up with this beautiful half a moon wreath.', price: '$50', image: 'https://lh3.googleusercontent.com/ttzfc3eGdLmBlJgxwX925w0gEO5sK1zzeLrY_swPry5ypaRfvTWhUYNbvrbIvC1cVhb-GA=s87' },
    { id: 3, name: 'Bow Angel', description: 'Big bow is the new style! Decorate your door this Fall with the beautiful wreath.', price: '$75', image: 'https://lh3.googleusercontent.com/oNnyRIFJ8U-8PxdY_7W67S-KCIpRtEi__RwEJpAOecaF-yeVl3aNLhaHD9IP4xlAnZr2go8=s85' },
    { id: 4, name: 'The N Wreath', description: 'Never had the letter N looked so good on your door! Fall wreath waiting just for you.', price: '$100', image: 'https://lh3.googleusercontent.com/XqP-BEvAsp7H7tD39KhA-eRx7G2vZ-6-VOaBhSPGIHObHSTPVriuS80QcswOAuyksqoypA=s85'},
    { id: 5, name: 'Beginning of Spring', description: 'Beautiful beginning of Spring wreath mixed with yellow and orange colors.', price: '$125', image: 'https://lh3.googleusercontent.com/TmLhqfju5WxDI-a67dbrwNlwpBL7AhglXpgcmhfOqS24X86fARb_pBHBA0obejFfKnU=s85' },
    { id: 6, name: 'End of Summer', description: 'Live up the Summer vibes with the end of the Summer wreath.', price: '$150', image: 'https://lh3.googleusercontent.com/wnoaFrlPeBq_u8GvfGa7P2XNAA9SV74nVEPoT4QL4VL4QEnKEYavxQp7eaSPnCkQbzG6aw=s85'},

    // { id: 1, name: 'Fall with Grapes', description: 'Fall decorations with grapes.', price: '$25', image: '../../assets/Fall-With-Grapes.png'},
    // { id: 2, name: 'Half a Moon', description: 'Half decorated wreath.', price: '$50', image: 'https://lh3.googleusercontent.com/ttzfc3eGdLmBlJgxwX925w0gEO5sK1zzeLrY_swPry5ypaRfvTWhUYNbvrbIvC1cVhb-GA=s87' },
    // { id: 3, name: 'Bow Angel', description: 'Big bow decrotaed wreath.', price: '$75', image: 'https://lh3.googleusercontent.com/oNnyRIFJ8U-8PxdY_7W67S-KCIpRtEi__RwEJpAOecaF-yeVl3aNLhaHD9IP4xlAnZr2go8=s85' },
    // { id: 4, name: 'The N Wreath', description: 'The letter N decorated Wreath.', price: '$100', image: 'https://lh3.googleusercontent.com/XqP-BEvAsp7H7tD39KhA-eRx7G2vZ-6-VOaBhSPGIHObHSTPVriuS80QcswOAuyksqoypA=s85'},
];

const Products = () => {
    const classes = useStyles();

    return (
        <main className={classes.content}>
            <div className={classes.toolbar} />
            <Grid container justify="center" spacing={4}>
                {products.map((product) => (
                    <Grid item key={product.id} xs={12} sm={6} md={4} lg={3}>
                        <Product product={product} />
                    </Grid>
                ))}
            </Grid>
        </main>
    );
}

export default Products;
